# Bitmap display starter code
#
# Bitmap Display Configuration:
# - Unit width in pixels: 4
# - Unit height in pixels: 4
# - Display width in pixels: 512
# - Display height in pixels: 256
# - Base Address for Display: 0x10008000 ($gp)
#
# Equivalences
# Codes will determine what type of block it is
# 0xAARRGGBB
# The AA field will be used to define whether a block is permeable or can damage the play
# 02XXXXXX is equivalent to numbers greather than 33554432 in decimal
# 00 - will not damage the user is permeable (air)
# 02 - will damage the user is pearmeable (we want the user to see that they walked into a saw/spike)

# addresses of IO
.eqv BASE_ADDRESS 0x10008000
.eqv KEYBOARD_ADDRESS 0xffff0000

.eqv MS_PER_FRAME 33
.eqv UNIT_PER_PIX 4
.eqv WIDTH 128
.eqv HEIGHT 64
.eqv WIDTH_BY_4 512
.eqv HEIGHT_BY_4 256
.eqv BACKGROUND_LENGTH 8192
.eqv JUMP_HEIGHT 8
.eqv STARTING_LOCATION 31772
.eqv DAMAGING_THRESHOLD 33554432

# these will be our colours
.eqv sawDarkGrey 0x028d8d8f
.eqv sawLightGrey 0x02e6e6e6
.eqv sawBlack 0x02000000
.eqv playerBody 0x00FFFFFF
.eqv playerEyes 0x00000000
.eqv playerHelmet 0x00aea9a9
.eqv playerFeather 0x00FF0000
.eqv platformColour 0x00d4d4d4

.data
debugOne: .asciiz "Register value "
newline: .asciiz "\n"

# hitpoints the character has left
hitpoints: .word 3

# number of saws that we have
sawCount: .word 2

# this will store the starting locations of the saws
sawStarting: .word 29864, 30004

# this will store the end locations of the saws
sawEnding: .word 29984, 30124

# this will store the state that saws are in frame (1 - 3)
sawStates: .word 0, 1, 2, 0, 1 , 2

# this will store the current locations of the saws (based on their centers)
sawLocations: .word 29984, 30004

# these will store which direction the saw is currently moving in
# 0: stationary
# -1: left
# 1: right
# 2: up
# -2: down
sawDirections: .word -1, 1, 0, 0, 0, 2

# these will store the state that the moving spike groups are in frames 1-7
spikeGroupStates: .word 1, 7, 1

currentPlayerLocation: .word STARTING_LOCATION # current player location using pixel units

# 1 for facing right -1 for facing left
currentCharacterDirection: .word 1

dashLengthRemaining: .word 0

# dash in progress if 1 else -1 signify no currently dashing
dashInProgress: .word -1

canDash: .word 1

canDoubleJump: .word 1

jumpLengthRemaining: .word 0

jumpInProgress: .word -1

redrawQueueLength: .word 0 # we will update this as needed and read up to this number to redraw

# dimmed lighting
background: .word 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00d4d4d4, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00010101, 0x00010101, 0x00020202, 0x00030303, 0x00040404, 0x00070707, 0x00090909, 0x000d0d0d, 0x00101010, 0x00141414, 0x00171717, 0x001a1a1a, 0x001d1d1d, 0x00808080, 0x003f3f40, 0x00adadad, 0x00888888, 0x00828283, 0x005d5d5d, 0x00acacad, 0x00848484, 0x00848484, 0x00ababac, 0x00adadae, 0x005f5f5f, 0x00959596, 0x00828282, 0x00a3a3a4, 0x005a5a5a, 0x003d3d3d, 0x00171717, 0x00151515, 0x